import { css } from "styled-components";

export const NotosansSemiBoldEerieBlack37px = css`
  color: var(--eerie-black);
  font-family: var(--font-family-noto_sans);
  font-size: var(--font-size-xxl);
  font-weight: 600;
  font-style: normal;
`;

export const NotosansNormalSonicSilver29px = css`
  color: var(--sonic-silver);
  font-family: var(--font-family-noto_sans);
  font-size: var(--font-size-m);
  font-weight: 400;
  font-style: normal;
`;

export const NanumsquareotfExtraExtraBoldWhite32 = css`
  color: var(--white);
  font-family: var(--font-family-nanumsquareotf-extrabold);
  font-size: var(--font-size-xl);
  font-weight: 800;
  font-style: normal;
`;

export const NotosansBoldBlueViolet21px = css`
  color: var(--blue-violet);
  font-family: var(--font-family-noto_sans);
  font-size: var(--font-size-s);
  font-weight: 700;
  font-style: normal;
`;

export const NotosansNormalEerieBlack22px = css`
  color: var(--eerie-black);
  font-family: var(--font-family-noto_sans);
  font-size: 22px;
  font-weight: 400;
  font-style: normal;
`;

export const NanumsquareotfRegularNormalWhite32p = css`
  color: var(--white);
  font-family: var(--font-family-nanumsquareotf-regular);
  font-size: var(--font-size-xl);
  font-weight: 400;
  font-style: normal;
`;

export const RobotoBoldWhite35px = css`
  color: var(--white);
  font-family: var(--font-family-roboto);
  font-size: 35px;
  font-weight: 700;
  font-style: normal;
`;

export const NanumsquareotfBoldWhite13px = css`
  color: var(--white);
  font-family: var(--font-family-nanumsquareotf-bold);
  font-size: var(--font-size-xs);
  font-weight: 700;
  font-style: normal;
`;

export const NanumsquareotfBoldSonicSilver13px = css`
  color: var(--sonic-silver);
  font-family: var(--font-family-nanumsquareotf-bold);
  font-size: var(--font-size-xs);
  font-weight: 700;
  font-style: normal;
`;

export const NotosansNormalSonicSilver30px = css`
  color: var(--sonic-silver);
  font-family: var(--font-family-noto_sans);
  font-size: var(--font-size-l);
  font-weight: 400;
  font-style: normal;
`;

export const NotosansExtraBoldEerieBlack41px = css`
  color: var(--eerie-black);
  font-family: var(--font-family-noto_sans);
  font-size: var(--font-size-xxxl);
  font-weight: 800;
  font-style: normal;
`;

export const NotosansNormalMountainMist25px = css`
  color: var(--mountain-mist);
  font-family: var(--font-family-noto_sans);
  font-size: 25px;
  font-weight: 400;
  font-style: normal;
`;

export const NotosansNormalMountainMist20px = css`
  color: var(--mountain-mist);
  font-family: var(--font-family-noto_sans);
  font-size: 20px;
  font-weight: 400;
  font-style: normal;
`;

export const RobotoBoldWhite27px = css`
  color: var(--white);
  font-family: var(--font-family-roboto);
  font-size: 27px;
  font-weight: 700;
  font-style: normal;
`;

export const NotosansNormalBlueViolet21px = css`
  color: var(--blue-violet);
  font-family: var(--font-family-noto_sans);
  font-size: var(--font-size-s);
  font-weight: 400;
  font-style: normal;
`;

export const Border3pxMountainMist = css`
  border: 3px solid var(--mountain-mist);
`;
